import { LineChart, XAxis, YAxis, CartesianGrid, Line, Tooltip, Legend } from "recharts";

const VariablesGraph = (props) => {
return <LineChart width={400} height={300} data={props.variables.hourly}>
<XAxis data={props.variables.hourly.time} dataKey="name" />
<YAxis />
<CartesianGrid stroke="#ccc" />
<Line type="monotone" dataKey="uv" stroke="#8884d8" />
<Line type="monotone" dataKey="pv" stroke="#82ca9d" />
<Tooltip />
<Legend />
</LineChart>
};

export default VariablesGraph;
